import { initSchema } from '@aws-amplify/datastore';
import { schema } from './schema';



const { Address, Party, Order, User, Branch, Organisation, Vehicle, Driver } = initSchema(schema);

export {
  Address,
  Party,
  Order,
  User,
  Branch,
  Organisation,
  Vehicle,
  Driver
};
